import React from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Import Bootstrap CSS
import "./App.css";
import logo from "./assets/logo.png";
import protection from "./assets/protection.png";
import lungs from "./assets/lungs.png";
import food from "./assets/food.png";
import mind from "./assets/mind.png";
import doge from "./assets/vetdoge.jpg";
import tic from "./assets/tic.png";

// Data for the feature cards
const features = [
  { img: protection, title: "Защита от зарази", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." },
  { img: lungs, title: "100% възтановяване", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus.", highlighted: true },
  { img: food, title: "Натурални съставки", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." },
  { img: mind, title: "Без травми", description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem velit viverra amet faucibus." }
];

// Data for the benefits list
const benefits = [
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit.",
  "Lorem ipsum dolor sit amet, consectetur adipiscing elit."
];

function App() {
  return (
    <div className="bio-marketing-container container">
      {/* Showcase section */}
      <div className="row py-5 bg-light">
        {/* Placeholder for showcase content */}
      </div>

      {/* Logo section */}
      <div className="row justify-content-center py-3">
        <div className="col-md-6 text-center">
          <img src={logo} alt="Bio Logo" className="img-fluid" />
        </div>
      </div>

      {/* Main text */}
      <div className="row py-3">
        <div className="col-12 text-center">
          <h1 className="main-text">Грижим се за тяхното здраве</h1>
        </div>
      </div>

      {/* Feature cards section */}
      <div className="row py-3">
        {features.map((feature, index) => (
          <div key={index} className={`col-md-6 col-lg-3 mb-4`}>
            <div className={`feature-card p-3 border rounded ${feature.highlighted ? "bg-primary text-white" : "bg-light"}`}>
              <img src={feature.img} alt={`${feature.title} Icon`} className="img-fluid mb-2" />
              <h2>{feature.title}</h2>
              <p>{feature.description}</p>
            </div>
          </div>
        ))}
      </div>

      {/* Choose us section */}
      <div className="row py-5">
        <div className="col-md-6 mb-4 mb-md-0">
          <img src={doge} alt="Decorative" className="img-fluid rounded" />
        </div>
        <div className="col-md-6">
          <h1 className="main-text">Защо да изберете нас?</h1>
          <ul className="list-unstyled">
            {benefits.map((benefit, index) => (
              <li key={index} className="d-flex align-items-start mb-3">
                <img src={tic} alt="Check" className="me-2" />
                {benefit}
              </li>
            ))}
          </ul>
          <a href="#" className="btn btn-link">Learn More →</a>
        </div>
      </div>
    </div>
  );
}

export default App;
